window.bookSummaryJSON = "<p><b>What lengths would you go to in order to pursue your dreams?</b></p> <p>Meggie Harper has been training her whole life for the Olympics, even though her omega status makes it illegal to compete.</p> <p>Despite the odds, she's determined to keep her designation a secret and make the Olympic swim team. That is until she fails to qualify.</p> <p>Just when she thinks all hope is lost, her best friend's brother presents her with a surprising opportunity and the chance to switch sports to compete on his Olympic water polo team. The only problem? She'll have to team up with six alphas and keep them from finding out her designation as an omega. Even worse, they all smell delicious.</p> <p>As her teammates start to pursue her, Meggie's heart and her secret are put at risk. Can she have the pack she's always wanted and still achieve her Olympic dreams?</p> <p><i>This book is part one of a two-part duet that's a continuing story. For fans of sizzling chemistry and lighthearted sports omegaverses, this book will leave you laughing, swooning, and fanning yourself.</i></p>"; 
